import React from 'react';
import {Card} from 'react-bootstrap';
import { Chart } from "react-google-charts";

export default class ArrowFormat extends React.Component{
    render(){
        return(
    <Card bg='light'>
      <Card.Body>
      <Chart
  width={'500px'}
  height={'300px'}
  chartType="Table"
  loader={<div>Loading Chart</div>}
  data={[
    ['Department', 'Revenues Change'],
    ['Shoes', { v: 12, f: '12.0%' }],
    ['Sports', { v: -7.3, f: '-7.3%' }],
    ['Toys', { v: 0, f: '0%' }],
    ['Electronics', { v: -2.1, f: '-2.1%' }],
    ['Food', { v: 22, f: '22.0%' }],
  ]}
  formatters={[
    {
      type: 'ArrowFormat',
      column: 1,
    },
  ]}
  options={{
    allowHtml: true,
    showRowNumber: true,
  }}

/>
    </Card.Body>
    </Card>


        );}
    }
